// OntologyList.js
import { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

import OntologyListItem from './OntologyListItem';

function OntologyList() {
    const [ontologies, setOntologies] = useState([]);

    useEffect(() => {
        const fetchOntologies = async () => {
            const result = await axios.get('http://localhost:8080/api/ontologies');

            setOntologies(result.data);
        };

        fetchOntologies();
    }, []);

    return (
        <div className={'App'}>
        <table className={'table-ontology'}>
            <thead>
            <tr>
                <th>Title</th>
            </tr>
            </thead>
            <tbody>
            {ontologies.map(ontology => (
                <OntologyListItem
                    key={ontology.id}
                    ontology={ontology}
                />
            ))}
            </tbody>
        </table>
        </div>
    );
}

export default OntologyList;
